PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?drug ?drugName ?target ?targetName ?mechanism
WHERE {
  ?drug a chembl:SmallMolecule ;
        rdfs:label ?drugName ;
        chembl:hasActivity ?activity ;
        chembl:hasMechanism ?mechanism .

  ?activity chembl:hasAssay ?assay .
  ?assay chembl:hasTarget ?target .

  ?target rdfs:label ?targetName ;
          chembl:targetType ?targetType .

  ?mechanism chembl:hasMechanismOfAction ?moa ;
             chembl:actionType ?actionType .

  # Filter for kinase targets
  FILTER(CONTAINS(LCASE(?targetName), ""kinase""))

  # Filter for marketed drugs
  ?drug chembl:highestDevelopmentPhase ""4""^^<http://www.w3.org/2001/XMLSchema#integer> .
}
LIMIT 100""}}, {""name"": ""mcp__togomcp__run_sparql"", ""input"": {""dbname"": ""chembl"", ""sparql_query"": ""PREFIX chembl: <http://rdf.ebi.ac.uk/terms/chembl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?molecule ?moleculeName ?maxPhase
WHERE {
  ?molecule a chembl:SmallMolecule ;
            rdfs:label ?moleculeName ;
            chembl:highestDevelopmentPhase ?maxPhase .

  # Filter for marketed drugs (phase 4)
  FILTER(?maxPhase = ""4""^^<http://www.w3.org/2001/XMLSchema#integer>)

  # Filter for kinase inhibitors by name
  FILTER(CONTAINS(LCASE(?moleculeName), ""kinase"")

